import styled from 'styled-components';

const FeedContainer = styled.div`
  flex: 5.5;
`;

const FeedWrapper = styled.div`
  padding: 20px;
`;

export default function Feed() {
  return (
    <FeedContainer>
      <FeedWrapper>
        {/* Your feed content goes here */}
      </FeedWrapper>
    </FeedContainer>
  );
}
